import './styleImage.css';

const InputImage = ({searchChange, submit}) => {
	return(
		<div>
		<p className='f3 center'> {'Please give your image link here'} </p>
		  <div className='background pa4 br4 shadow-5 w-50 center'>
		    <input className='f3 pa2 w-70' type= 'tex' onChange = {searchChange}/>
            <button className = 'w-30 f3 link ph3 pv2 dib bg-light-purple grow pointer'
            onClick = {submit}> Detect </button>
		  </div>
		</div>
		);
};

export default InputImage;
